import React from "react";
import Dreamdog from "../Images/Dreamdog.jpg"; // Import the image

function DreamdogComponent() {
    return (
        <div style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "100vh",
            backgroundImage: `url(${Dreamdog})`, // Use the correct variable name
            backgroundPosition: "center",
            backgroundSize: "cover",
            backgroundRepeat: "no-repeat"
        }}>
            <div style={{ backgroundColor: "rgba(255, 255, 255, 0.8)", padding: "20px" }}>
                <h1>Centered Child Container with Background Image</h1>
                <p>This child container is centered within the parent with a background image.</p>
            </div>
        </div>
    );
}

export default DreamdogComponent;
